import React from "react";

const Alert = (props) => {
  return (
      setTimeout(() => {
      <div className="alert alert-warning alert-dismissible fade show bg-success text-light" role="alert">
       { props.message}
      </div> 
      }, 3000)
  )
};

export default Alert;
